import Link from "next/link";
import Header from "../components/header";
export default function Index() {
  return (
    <>
       <div className="App">
      <Navbar></Navbar>
      <div className="App-header">
      <Header></Header>
      </div>

      <h1>Hello World!</h1>
      <Link href="/about">About.js</Link>
      <a href="/about">About.js</a>
      </div>
    </>
  );
}
